import React from "react";
// import {Link} from 'react-router-dom';


const Navbar =()=>{
    return (
        <nav>
            <div>
                <h1>Disctionary App</h1>
            </div>
            
                
                    <Link to="/">Home</Link>
                
                
                    <Link to="/history">History</Link>
            
            
        </nav>
    )
}

export default Navbar;
